@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

atm:Transaction a owl:Class .
atm:hasLimit a owl:DatatypeProperty ;
    rdfs:domain atm:Transaction ;
    rdfs:range xsd:decimal .
atm:requestedAmount a owl:DatatypeProperty ;
    rdfs:domain atm:Transaction ;
    rdfs:range xsd:decimal .

atm:Transaction owl:equivalentClass [
    a owl:Restriction ;
    owl:onProperty atm:requestedAmount ;
    owl:qualifiedMaxExclusive [
        a owl:Restriction ;
        owl:onProperty atm:hasLimit ;
        owl:allValuesFrom xsd:decimal
    ]
] .
